We sat down with Georgia and Tom to talk about how these two as a couple overcame many health and mental issues most notably, Georgia’s skin.
.
These guys share where to start if you’re having skin issues, what helps them stay healthy and positive, their daily routines that keep them functioning at 100% and so much more 💕
.
We really admire this couple and we have sooo much in common. We’ve learnt a lot from them and we are sure you will too 💕🥰
